import React from 'react'
import {Col, Row} from 'antd'
import {SearchCard} from '../molecules'
import {useStore} from 'effector-react'
import {useTranslation} from 'react-i18next'
import {$searchModel} from '../../../../Models/search-model'
import {Title} from '../../../../UIComponents/Typography/Title'
import {NoSearchResultSvg} from '../../../../Icons/NoSearchResult'
import {EmptyContainerWrapper, RootContent} from '../../../../UIComponents/GlobalStyles'


export const AllSearchList = ({searchText}) => {
    const {t} = useTranslation()
    const {$searchList: {data}} = useStore($searchModel)

    return (
        <RootContent
            paddingTop='102px'
            paddingBottom='10px'
        >
            <Row gutter={[0, 12]} style={{padding: '0 12px'}}>
                {
                    searchText.trim().length > 0 && data && data.length > 0
                        ? data.map((item, idx) => (
                            <Col
                                span={24}
                                key={`${idx + 1}`}
                            >
                                <SearchCard
                                    size={40}
                                    src={item.logo}
                                    title={item.name}
                                    text={t('organization')}
                                />
                            </Col>
                        ))
                        : <EmptyContainerWrapper>
                            <NoSearchResultSvg/>
                            <Title>{t('no_search_result')}</Title>
                        </EmptyContainerWrapper>
                }
            </Row>
        </RootContent>
    )
}
